import React from 'react';

class Form extends React.Component {
  render() {
    return (
      <form>
        <h1>Add nova carta</h1>
        <br />
        <br />

        <input type="text" data-testid="name-input" />
        <textarea cols="30" rows="10" data-testid="description-input"></textarea>
      </form>
    );
  }
}

export default Form;
